import React from 'react';
import { Link } from 'react-router-dom';
import Navbar from './Navbar';
import Footer from './Footer';

const LandingPage = () => {
    return (
        <>
            <Navbar />
            <main className="main-content">
                <section className="hero-section">
                    <div className="hero-overlay">
                        <h1>Welcome to <span>CrickBidders</span></h1>
                        <p>Your ultimate platform for cricket auctions!</p>
                        <div className="button-container">
                            <Link to="/signup" className="button button-signup">Get Started</Link>
                            <Link to="/login" className="button button-login">Log In</Link>
                        </div>
                    </div>
                </section>
            </main>
            <Footer />
        </>
    );
};

export default LandingPage;
